/* Procedure structure for procedure `order_payment_migrate` */

/*!50003 DROP PROCEDURE IF EXISTS  `order_payment_migrate` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`somsuat`@`localhost` PROCEDURE `order_payment_migrate`()
main:BEGIN
    DECLARE p_total_order INT;
    DECLARE p_order_id INT;
    DECLARE p_order_client_id INT;
    DECLARE p_order_payment_type_id INT;
    DECLARE p_order_payment_status_id INT;
    DECLARE p_order_total_fee DECIMAL(8,2);
    DECLARE p_order_paid_fee DECIMAL(8,2);
    DECLARE p_order_trans_id VARCHAR(255);
    DECLARE p_order_pay_qr_code VARCHAR(255);
    DECLARE p_today CHAR(10);
    
    DECLARE cursorTest CURSOR FOR
    	    	SELECT 
        soms_orders.id,
        soms_orders.client_id,
        soms_orders.payment_type_id, 
        soms_orders.payment_status_id,
        soms_orders.total_fee,
        soms_orders.paid_fee,
        soms_orders.trans_id,
        soms_orders.pay_qr_code
        FROM `soms_orders` WHERE current_version = 1 
        AND NOT EXISTS (SELECT 1 FROM soms_order_payments WHERE soms_order_payments.order_id = soms_orders.id);
       
    SELECT COUNT(*) INTO p_total_order FROM soms_orders;
    SELECT DATE_FORMAT(NOW(),'%Y-%m-%d') INTO p_today;
   
    SET @orderIndex = 0;
    OPEN cursorTest;
    WHILE p_total_order > @orderIndex DO
        FETCH cursorTest INTO p_order_id, p_order_client_id, 
        	p_order_payment_type_id, p_order_payment_status_id,
            p_order_total_fee, p_order_paid_fee,
            p_order_trans_id, p_order_pay_qr_code;
        
 p_order_payment_type_id,p_order_payment_status_id,
 p_order_total_fee,p_order_paid_fee,
 p_order_trans_id,p_order_pay_qr_code,NOW(),NOW(),NOW(),NULL);
                
        SET @orderIndex = @orderIndex + 1;
    END WHILE;
    CLOSE cursorTest;
END */$$
DELIMITER ;

